        "date": "2015-04-21T07:42:10Z"
      },
      "message": "Fix printing of locals in the debugger.\n\nThe bytecode pointer for a frame is the return address and is\ntherefore not the current location in the code. Therefore, when\nlooking up scope information we have to search for bytecode\npointer minus one. We already do this correctly for other\nlookups.\n\nIt would have been nice to record the correct bytecode\npointer for a frame. However, that would require us to know the\nsize of the previous bytecode which we can't unless we iterate\nfrom the top.\n\nR=zerny@google.com\n\nReview URL: https://codereview.chromium.org/1070283003",
