  {
    "sha": "374fa9a75bab6d7e32bb791aaf3deaddcbf84788",
    "commit": {
      "author": {
        "name": "Martin Kustermann",
        "email": "kustermann@google.com",
        "date": "2015-04-16T10:39:04Z"
      },
      "committer": {
        "name": "Martin Kustermann",
        "email": "kustermann@google.com",
        "date": "2015-04-16T10:39:04Z"
      },
      "message": "Add fletch as an input to actions which generate snapshots\n\nSnapshots are generated by launching fletchc. But fletchc will at runtime use\nthe fletch VM to generate the snapshot (it launches fletch VM as subprocess). We\ntherefore need to include the fletch VM as input to all actions which generate\nsnapshots.\n\nPreviously a change of the fletch VM didn't trigger a regeneration of snapshots:\n\n  % ninja -C out/DebugIA32\n  ninja: Entering directory `out/DebugIA32'\n  ninja: no work to do.\n\n  % touch out/DebugIA32/fletch\n\n  % ninja -C out/DebugIA32\n  ninja: Entering directory `out/DebugIA32'\n  [4/4] STAMP obj/run_service_performance_test.actions_depends.stamp\n\nNow a change will trigger a rebuild of snapshots:\n\n  % ninja -C out/DebugIA32\n  ninja: Entering directory `out/DebugIA32'\n  ninja: no work to do.\n\n  % touch out/DebugIA32/fletch\n  % ninja -C out/DebugIA32\n  ninja: Entering directory `out/DebugIA32'\n  [8/16] ACTION run_service_performance_test: generate_service_performance_snapshot_fdd08e024064c0aaa1ca4d79f7817d14\n  [9/16] ACTION run_myapi_test: generate_myapi_snapshot_a00887f90c14d16fb92ec3f2e74f79d8\n  [10/16] ACTION run_myapi_test: run_myapi_test_a00887f90c14d16fb92ec3f2e74f79d8\n  [11/16] ACTION run_service_conformance_test: generate_service_conformance_snapshot_d78ab502b8e1130caa6f78f1f3781e6e\n  [12/16] ACTION run_service_performance_test: run_service_performance_test_fdd08e024064c0aaa1ca4d79f7817d14\n  [14/16] ACTION run_todomvc_sample: generate_todomvc_snapshot_6953b22f0aaa45bf5d97c516229e39aa\n  [15/16] ACTION run_todomvc_sample: run_todomvc_sample_6953b22f0aaa45bf5d97c516229e39aa\n  [16/16] STAMP obj/run_todomvc_sample.actions_rules_copies.stamp\n\nBUG=\nR=kasperl@google.com\n\nReview URL: https://codereview.chromium.org/1055813005",
