      "message": "Fix broken GNUMakefile: Building fletch requires GYP_CROSSCOMPILE to be set\n\nIf one removes the 'out' directory and runs 'make' it will automatically run gyp\nas well. But as opposed to the gclient runhook, it was missing the\nGYP_CROSSCOMPILE environment variable which caused the generated ninja files to\nbe broken (since gyp will not emit ninja files for host and target toolset\nwithout the GYP_CROSSCOMPILE being set, which causes circular dependencies in\nthe ninja build targets, which makes one unable to build).\n\nR=ahe@google.com\n\nReview URL: https://codereview.chromium.org/1091553004",
