      "committer": {
        "name": "Mads Ager",
        "email": "ager@google.com",
        "date": "2015-04-14T11:40:50Z"
      },
      "message": "Implement source-level stepping.\n\nThe fletchc debugger now works more like gdb.\n\n'bt' gives you a stack trace with file and line information.\n\nThe 'f <n>' command selects a frame.\n\nThe 'l' (list source) comment prints the source with the current\nlocation highlighted for the selected frame.\n\n The 'disasm' command prints the bytecodes for the currently\nselected frame.\n\n's' and 'so' are now source level step instructions.\n\n'sb' and 'sob' are bytecode level step instructions.\n\nThere is a bunch of code in debug_info.dart that could potentially\nbe in dart2js instead. Most of it is taken from there and adapted\nto our needs.\n\nR=ajohnsen@google.com, ahe@google.com\n\nReview URL: https://codereview.chromium.org/1064013005",
      "tree": {
