        "date": "2015-04-13T08:23:05Z"
      },
      "message": "Generate debug info for a CompiledFunction on the fly when needed.\n\nThis is currently used in bytecode-level stack traces to show the\ncorresponding ast node (pretty printed) for an instruction.\n\nFor the program:\n\nclass A {\n  var x = 42;\n  t() => x;\n}\n\nmain() {\n  if (new A().t() > 42) {\n    print('fisk');\n  } else {\n    print('hest');\n  }\n\n  return 43;\n}\n\nWe get the following stack trace when breaking at entry to t:\n\n> b t\nbreakpoint set: 0: t@0\n> r\n> bt\nStack trace:\n  0: t\n  >   0 load local 1             // x\n      1 invoke 130304 (x)        // x\n      6 return 1 1               // =>x;\n      9 method end 9             // =>x;\n\n  1: main\n      0 invoke static @0         // new A()\n  >   5 invoke 39936 (t)         // new A().t()\n     10 load literal 42          // 42\n     12 invoke gt18433           // new A().t()>42\n     17 branch if true +10       // new A().t()>42\n     22 branch +21               // new A().t()>42\n     27 load const @1            // 'fisk'\n     32 invoke static @2         // print('fisk')\n     37 pop                      // print('fisk')\n     38 branch +16               // print('fisk')\n     43 load const @3            // 'hest'\n     48 invoke static @2         // print('hest')\n     53 pop                      // print('hest')\n     54 load literal 43          // 43\n     56 return 1 0               // return 43;\n     59 method end 59            // return 43;\n\n  2: entry\n  >   0 invoke static @0         // invokeMain()\n      5 invoke static @1         // Thread.exit(invokeMain())\n     10 pop                      // Thread.exit(invokeMain())\n     11 load literal null        // Thread.exit(invokeMain())\n     12 return 1 1               // Thread.exit(invokeMain())\n     15 method end 15            // Thread.exit(invokeMain())\n\nR=ahe@google.com, ajohnsen@google.com\n\nReview URL: https://codereview.chromium.org/1075223002",
