      "committer": {
        "name": "Kasper Lund",
        "email": "kasperl@google.com",
        "date": "2015-03-19T09:51:02Z"
      },
      "message": "Use a \"virtual table\" rather than the lookup cache when invoking methods\nin folded (read: optimized) mode.\n\nFor a method call like this:\n\n   obj.foo()\n\nthe new virtual table dispatch mechanism fetches the id for the class of\nobj and adds an offset derived from the foo selector:\n\n   int index = class(obj).id + offset(#foo);\n   Entry entry = vtable[index];\n\nThe entry has to be validated before we can call the target method in\nit but that is a simple offset check:\n\n   if (entry.offset != offset(#foo)) obj.noSuchMethod(#foo);\n   else entry.target(obj);\n\nNext steps include making the table more compact, introducing better\nabstractions for the data encoded in arrays, and refactoring the code\nout of program.cc.\n\nR=ager@google.com\nBUG=\n\nReview URL: https://codereview.chromium.org/999933003",
