        "date": "2015-03-17T09:15:14Z"
      },
      "message": "Introduce a separate array for the dispatch table instead of putting them in the program's constant array and flatten the structure so the indexes encoded in the invoke-method-fast bytecodes indicate where the method search starts in one big array.\n\nThis approach saves a bit of memory because it avoids a lot of array\nheaders and it should have better data locality.\n\nR=ager@google.com\nBUG=\n\nReview URL: https://codereview.chromium.org/1014773002",
