        "date": "2015-03-17T08:05:32Z"
      },
      "message": "Record fixed size of instances in number of pointers instead of number of bytes.\n\nWhen reading Functions from the snapshot always round up the\nbytecode size to kPointerSize.\n\nThis allow reading in a ia32 snapshot on x64 if we overallocate\nthe initial heap by a factor of two. I haven't done that in this\nchange. Instead I will write two sizes in the snapshot in an\nupcoming change and chose the right one based on the current\nplatform.\n\nR=kasperl@google.com\n\nReview URL: https://codereview.chromium.org/1012753002",
