      "message": "Support string type in service idl descriptions.\n\nThis is not pretty; so take this as a request for comments as well.\n\nI decided to make string a primitive type during compilation, not sure\nthat was a good move.\n\nAt this point I am completely ignoring string encodings.\n\nYou get a copy of the string on every invocation of the getter for\na string in a struct.\n\nI'll clean this up a bit tomorrow. Let me know what you think. Ian,\ncould something like this be turned into something useful for you?\n\nR=zerny@google.com, kasperl@google.com\n\nReview URL: https://codereview.chromium.org/995423002",
