        "date": "2015-03-09T10:58:30Z"
      },
      "message": "Add all files to the Android studio project to get a working sample.\n\nAs far as I can tell it is not possible to point to other\ndirectories, so it seems that we have to copy everything\nin here. Fortunately, the steps are simple:\n\n1. Generate the java and jni code and copy the java code.\n\n [tools/servicec]$ dart ./bin/servicec.dart --out=../../samples/todomvc/ ../../samples/todomvc/todomvc_service.idl\n [samples/todomvc/java]$ cp -R fletch/* ../android/TodoMVC/app/src/main/java/fletch/\n\n2. Build libfletch.so which contains all of the fletch runtime\n   and the jni code and copy it.\n\n [samples/todomvc/java]$ NDK_MODULE_PATH=. ndk-build\n [samples/todomvc/java]$ libs/* ../android/TodoMVC/app/src/main/jniLibs/\n\n3. Build the snapshot and copy it.\n\n [samples/todomvc]$ ../../out/ReleaseIA32/fletch todomvc.dart --out=todomvc_snapshot\n [samples/todomvc]$ cp todomvc_snapshot android/TodoMVC/app/src/main/res/raw/\n\nR=zerny@google.com\n\nReview URL: https://codereview.chromium.org/984913003",
