      "message": "Add API to add default shared libraries for the foreign function API.\n\nThis is useful on Android where we will probably end up with a\nshared library that contains all Dart service jni code. The Android\ndeveloper who loads that library knows what it is called. In order\nto not have to have that knowledge in the Dart service implementation\nit is exposed through the API so it can be added when we actually\nhave the knowledge.\n\nR=kasperl@google.com\nBUG=\n\nReview URL: https://codereview.chromium.org/860063003",
